import React from "react";
import TillbakaSkarm from "./TillbakaSkarm";

function KalenderSkarm({ navigation }) {
  return (
    <TillbakaSkarm navigation={navigation} text="Kalender"></TillbakaSkarm>
  );
}

export default KalenderSkarm;
